        //         backgroundColor: "#FEFFFE",
        //     }}
        // >
        //     <Header />
        //     <Messages />
        //     <FooterChat />

        // </div>
        <Anime
            easing="easeOutElastic"
            duration={1000}
            direction="alternate"
            loop={true}
            delay={(el, index) => index * 240}
            translateX="13rem"
            scale={[0.75, 0.9]}
        >
            <div className="blue">Testing</div>
            <div className="green" />
            <div className="red" />
        </Anime>
    );
}

export default App;
